import React, { useState } from 'react';
import './Update.css';
import Header from '../components/Header';
import Footer from '../components/Footer';

const Update = () => {
  return (
    <>
      <div className="schedule-container">
        <h1>Doctor Java Technologies</h1>
        <h2>Schedules for Saturday 07/12/2024</h2>
        <ul>
          <li>10.30 to 11.30 - Shweta Core Java</li>
          <li>12.00 to 13.00 - Project Review</li>
          <li>13.00 to 14.00 - Lunch Break</li>
          <li>14.00 to 17.00 - Shivraj (Spring)</li>
          <li>17.00 to 18.00 - Project Review</li>
          <li>18.00 to 20.00 - Spring Project</li>
        </ul>
        <p><strong>Note:</strong> Schedule cannot be changed once fixed.</p>
      </div>
    </>
  );
};

export default Schedule;
